DROP DATABASE cleardata;
CREATE DATABASE cleardata;
use cleardata; 
CREATE TABLE agence (
  idAgence INT,
  nomAgence TEXT,
  villeAgence TEXT,
  region TEXT
);


CREATE TABLE personnel (
  idPersonnel INT,
  nom TEXT,
  prenom TEXT,
  idAgence INT,
  dateDebutContrat DATE,
  adresse TEXT,
  DateNaissance DATE,
  Poste TEXT,
  diplôme TEXT
);


CREATE TABLE rapport (
  idRapport INT PRIMARY KEY,
  Titre TEXT,
  DateRapport DATE,
  NOMauteur TEXT,
  PRENOMauteur TEXT,
  idGaz INT
);



CREATE TABLE donnée (
  idDonnee INT,
  DateDonnee DATE,
  concentration_ppm FLOAT,
  idGaz INT,
  idCapteur INT
);



CREATE TABLE capteur (
  idCapteur INT PRIMARY KEY,
  typeCapteur TEXT,
  etat TEXT,
  VilleCapteur TEXT,
  region TEXT
);


CREATE TABLE gaz (
  idGaz INT,
  nomGaz TEXT,
  singleFormule TEXT,
  typeGaz TEXT
);


